// add html to the body of the current page
var div = document.createElement('div');
div.innerHTML = `
<img id="floatingImageYuna" src="#" alt="Yuna AI">

<div id="popoverContainerYuna">
    <div id="popover-header-yuna">
        <h3 class="title">Yuna</h3>
        <button id="closeButton" class="btn btn-danger">X</button>
    </div>
    <div id="chatArea" class="popover-body">
        <!-- Chat bubbles will be added here dynamically -->
    </div>
    <div class="chat-input-area">
        <input type="text" id="inputFieldYuna">
        <button id="submitButton">&#x2B06;</button>
    </div>
</div>`;
document.body.appendChild(div);

document.getElementById('floatingImageYuna').src = 'data:image/png;base64,' + imageYuna;

// Vanilla JavaScript to toggle the popover and handle chat
var floatingImageYuna = document.getElementById('floatingImageYuna');
var popover = document.getElementById('popoverContainerYuna');
var inputFieldYuna = document.getElementById('inputFieldYuna');
var submitButton = document.getElementById('submitButton');
var chatHistory = JSON.parse(localStorage.getItem('chatHistory')) || [];
var closeBtn = document.getElementById('closeButton');

function updateChatHistory(message, sender) {
    chatHistory.push({
        sender: sender,
        message: message
    });
    localStorage.setItem('chatHistory', JSON.stringify(chatHistory));
    displayChatHistory();
}

function displayChatHistory() {
    var chatArea = document.getElementById('chatArea');
    chatArea.innerHTML = ''; // Clear previous chat bubbles
    chatHistory.forEach(function (entry) {
        var bubble = document.createElement('div');
        bubble.className = 'chat-bubble ' + (entry.sender === 'Yuki' ? 'you' : 'yuna');
        bubble.textContent = entry.message;
        chatArea.appendChild(bubble);
    });
    chatArea.scrollTop = chatArea.scrollHeight; // Scroll to the bottom
}

function startYunaChat() {
    var isDisplayed = popover.style.display === 'block';
    popover.style.display = isDisplayed ? 'none' : 'block';
    popover.style.opacity = isDisplayed ? 0 : 1;
    displayChatHistory();
};

submitButton.addEventListener('click', function () {
    var input = inputFieldYuna.value.trim();
    if (input) {
        updateChatHistory(input, 'Yuki');
        inputFieldYuna.value = '';
    }

    // Simulate Yuna's response
    setTimeout(function () {
        updateChatHistory('I am a simple AI and cannot respond to that.', 'Yuna');
    }, 1000);
});

inputFieldYuna.addEventListener('keypress', function (e) {
    if (e.key === 'Enter') {
        updateChatHistory(inputFieldYuna.value, 'Yuki');
        inputFieldYuna.value = '';
    }
});

// Add a clear chat button
var clearChatButton = document.createElement('button');
clearChatButton.textContent = 'Clear Chat';
clearChatButton.className = 'btn btn-secondary mt-2';
clearChatButton.addEventListener('click', function () {
    localStorage.removeItem('chatHistory');
    chatHistory = [];
    inputFieldYuna.value = '';
});
popover.querySelector('.popover-body').appendChild(clearChatButton);

// Initialize chat history display on load
window.onload = displayChatHistory;

floatingImageYuna.addEventListener('click', startYunaChat);
closeBtn.addEventListener('click', startYunaChat);

// Create a new style element
var style = document.createElement('style');
style.appendChild(document.createTextNode(css));
document.head.appendChild(style);

// Append the style element to the head
document.head.appendChild(style);

// if .heart exists, add event listener to it
if (document.querySelector('#heart-yuna')) {
    var styleHeart = document.createElement('style');
    styleHeart.appendChild(document.createTextNode(cssHeart));
    document.head.appendChild(styleHeart);

    document.querySelector('#search-input-yuna').addEventListener('keypress', function (event) {
        if (event.key === 'Enter') {
            event.preventDefault();
            const query = this.value;
            window.open("https://www.google.com/search?q=" + encodeURIComponent(query), '_parent');
        }
    });

    document.querySelector('#heart-yuna').addEventListener('click', function (event) {
        event.preventDefault();
        const query = document.querySelector('#search-input-yuna').value;
        window.open("https://www.google.com/search?q=" + encodeURIComponent(query), '_parent');
    });
}
